import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './UserActivityEntry.css';

class UserActivityEntry extends React.Component {
  render(){
    return(
      <body>
        <div class = "dashboard">
          <ul class = "flex_container">
            <li>Date</li>
            <li>Author</li>
            <li>Action</li>
            <li>Description</li>
          </ul>
        </div>
      </body>
    )
  }
}

export default UserActivityEntry;
